full_text:
@pumblechook Hi there. We absolutely appreciate your feedback and we will be sure to forward this information through the proper channels. 

Feel free to submit your feedback here as well: https://t.co/kXzuRqMc5X. 

If we can help you with anything else in the meantime, please let us know.

@bobmatnyc Hi Bob. We're glad to hear you're enjoying your Ring products and we certainly appreciate your feedback. 

Feel free to submit your feedback here as well: https://t.co/kXzuRquAHn. 

If we can help you out with anything, please reach back out to us.

@insuranceconcep If your internet connection is adequate, you should be able to access the Ring App just fine. 

Do you have another mobile device that you would be able to attempt to access the Ring App on? 

If so, please give that a try and let us know your results.

@Teslarow Thanks for getting in touch with us, Josh. You are able to adjust the volume of your App Alert Tones within the Ring App. 

To learn how to do this, see here: https://t.co/VqvkczidHb. 

If this doesn't resolve your concern, please let us know.

@skacoread With one wire connected, your Ring Doorbell may not be able to maintain its hardwired connection. 

Currently, we have no news to share regarding the ability to disable the internal chime kit from the Ring App. 

Feel free to submit your suggestion here: https://t.co/kXzuRquAHn.

@skacoread We appreciate you confirming that for us. Currently, your Video Doorbell will activate your internal chime kit if it is hardwired. 

However, you are able to hardwire your Video Doorbell directly to your transformer. 

To learn more, see here: https://t.co/mBdUgXunr6.

@DougBates8 Thanks for reaching out, Doug. Currently, all of our Ring devices have a fixed field of view. 

We appreciate your feedback and we will forward this information to the proper team for further review. 

Feel free to submit your feedback here as well: https://t.co/kXzuRquAHn.

@MAKEmiamiBETTER Hey there, thanks for getting in touch with us. You're able to filter your Event History by date after logging into https://t.co/Uj3hah8tux. 

For more information about how to do this, see here: https://t.co/6vyT1e6OoJ. 

Please let us know if you have any other questions.

@LFrequency6 Hey there, thanks for reaching out. All Ring devices do require a connection to a home wifi network. 

For more information about how our devices work, see here: https://t.co/IXlx1EnZgC. 

Rest assured, you will also be able to access your Ring devices from your mobile phone.

@HINEandPRINGLE Hey there, thanks for getting in touch with us. You are currently able to change the Alert Tone that plays from your mobile device and your Ring Chime. 

For more information about how to do this, see here: https://t.co/NcVzTe9FHE. 

If you have any other questions, let us know.

@CarrieAnnFain If your wifi is disconnected, your Ring Alarm will enter Cellular Backup. 

You may have limited app functionality while in Cellular Backup, but you can still arm and disarm your Ring Alarm. 

With Professional Monitoring, Cellular Backup will ensure the signal gets out. https://t.co/ZHjJfQqfcA

@martinmiller Are there events that you are expecting to see recorded during that time? 

If so, we would be more than happy to take a closer look into this for you. 

Please reach out to us via DM and let us know which model Ring device you have so we can help further. https://t.co/ZHjJfQqfcA

@Hoey1 Hey Joey. While we don't have anything to share about a Ring App for Apple TV, many of our Ring devices are compatible with the Alexa-enabled Fire TV. 

For more information, see here: https://t.co/ycZuCWAufB. 

If you have other questions, please let us know.

@innovate_fin Hey there, we're sorry to hear your experience with our over-the-phone support team was less than ideal. 

Were you able to finish the process of returning your Ring products? 

Feel free to reach out to us via DM and let us know if you need further assistance. https://t.co/ZHjJfQqfcA

@TheMikeDubin Hey Mike. We want to be sure that you are able to rely on your Stick Up Cam at all times to provide you with peace of mind. 

Please reach out to us via DM and send us a screenshot of the Device Health page within the Ring App. 

We look forward to getting this taken care of! https://t.co/ZHjJfQqfcA

@19markz82 We're glad to hear you're enjoying your Ring devices, Mark! 

While it's not Live View, Camera Previews are a series of still images you'll see when you first open up the Ring app. 

For more information about Camera Previews, see here: https://t.co/VOjcTYlbHm.

@TangheT That's great to hear! If power is lost, the Video Doorbell Pro will need to go through its initial charging period again. 

This can take about an hour, depending on how long power was lost. 

If there is anything else that we can help you out with, please let us know.

@TangheT Hey Tanguy, we want to be sure that your Video Doorbell is working properly to provide you with peace of mind. 

Would you mind sending us a screenshot of the Device Health page within your Ring App via DM? 

We want to learn more about what you are experiencing. https://t.co/ZHjJfQqfcA
